style.css:
@-moz-document domain("youtrack.etg.team") {
div[data-test="ticket-content"] aside[class*="sidebarContainer__"] div[class*="field__"] {
  padding: 0 5px;
}
div[data-test="ticket-content"] label[class*="fieldLabel__"] {
  text-align: right;
}
div[data-test="ticket-content"] span[class*="sidebarField__"] span[class*="ring-ui-inner_"] {
  text-wrap: nowrap;
}


div[data-test="ticket-content"] div[aria-label="State"] {
  background-color: #ffdbdb;
}
div[data-test="ticket-content"] div[aria-label="Estimation"] {
  display: none;
}

div.yt-agile-card__summary div.toggl-button {
  position: absolute;
  right: 0;
  top: 0;
}
}
